import React, { Component } from 'react';
import { render } from 'react-dom';
import "./config";
import { withScriptjs } from "react-google-maps";
import Map from "./googlemap";


const MapLoader = withScriptjs(Map);

const places = [
  {
    name: "Newcastle",
    title: "Newcastle",
    lat: -33.0029954,
    lng: 147.204751,
    id: 1
  },
  {
    name: "Sydney",
    title: "Sydney",
    lat: -33.847927,
    lng: 150.6517938,
    id: 2
  },
  {
    name: "Melbourne",
    title: "Melbourne",
    lat: -37.9722342,
    lng: 144.7729561,
    id: 3
  },
  {
    name: "Perth",
    title: "Perth",
    lat: -31.9546904,
    lng: 115.8350292,
    id: 4
  }
];

const App = () => {


  return (
    <MapLoader
      googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyDzzi_VBcf2Oef6LTViLU767UPNHlnIze4"
      loadingElement={<div style={{ height: `100%` }} />}
    />
  );
};

export default App;
